import React from 'react';
import './Logo.css';
import { TweenMax, Power3 } from 'gsap';

// Return logo view 
export default function REturnlogo() {

 React.useEffect(() => {
  TweenMax.from('.wrp-logo-withdraw', 1, { delay: .5, opacity: 0, y: 0, ease: Power3.easeIn })

 }, []);

 return (
  <div className='wrp-logo-withdraw'>
   <img src={'/img/logo.jpg'} alt={'logo view '} />
  </div>
 );
};
